INSERT [dbo].[RefValue] ([Id], [Status], [InsertDate], [UpdateDate], [IsActive], [Value], [Name], [RefTypeId], [Description], [Image], [ImageText]) VALUES (27, 1, CAST(N'2020-01-07T10:15:47.7939582' AS DateTime2), CAST(N'2020-03-20T20:36:51.6050381' AS DateTime2), 1, N'<p>Domain-driven design is an approach and founded by Martin Fawler. It can sometimes be confused with the design-pattern. But it’s not. Domain-Driven design is simply a model that is created by a software architecture depends on your client’s problem. It advised us to separate your business layers and manage them as modular. For instance, this model presents some infrastructures but it can be changed depends on your application or solution. I have a template project in GitHub I can show you. This is an empty project infrastructure and includes some different technologies such as GraphQL, event sourcing and more like then. We can understand clearly that this approaching support different types of technology or platform.</p><p>If I have to give an example more detailed, we have an imaginary client and sell some cosmetic products. Also, it has many branches and wants to manage its own business from a certain center. It wants to manage its selling rates, inventory, selling transactions and similar things. Actually it’s a clear situation. We can say that data flow has “one to many” relations.</p><p>In this case, we have 2 applications, the client-side application, and reporting application. The Client-side application consumes branch requests to persists data to a database via Web API. The report application reads data from a database and monitors them to users. These applications have different databases and both of them are on the same application. I’m starting to describe with Client-Side application and we can call it “Payment System”.</p><p><strong>Bounded Context</strong></p><p>Payment System receives its request via Web API and has some business rules. These rules include payment transactions, inventory management, branch management, user management. Each of the rules creates their own logics and we can separate them from each other. It’s called that process is “Bounded Context” and each context has its own sub-contexts. For example, we have a “Payment” context for Payment Management stuff. This Payment context has also sub-contexts such as “Payment.PaymentTransaction”, “ Payment.PaymentCancel”, “ Payment.PaymentOrder”, “Payment.PaymentType”, “ Payment.Reconciliation”. We can say all these to sub-context “PaymentContext”. When we can implement our Payment System in this way, 4 contexts and also these have their own sub-contexts create our main context. You can see the example Bounded Context Scheme below here.</p><p>&nbsp;</p><figure class='image'><img src='https://miro.medium.com/max/906/1*wZYOCVtim97DXVp_vrpqkw.png'></figure><p>Bounded Context Scheme</p><p>Actually Bounded Context describes us our application domain. Before describing the Payment System application technical infrastructure, It’s good to describe Doman Driven Design application layers. DDD has 4 initial layers. Core/Infrastructure, Domain, Application, and User-interface. From Core to UI in DDD Layers, effects are being decreased but logical stuff is being increased. For example, a code snipped which defined in Core Layer will affect entire projects, on the other hand, a code snipped which defined in UI Layer will affect only itself. That’s why Martin Fawler advises, developer have to implement all logic in the context. It provides less code complexity. An Example solution architecture with DDD is below here;</p><p>&nbsp;</p><figure class='image'><img src='https://miro.medium.com/max/326/1*wfk-ajJI6kuF7Wf83SDo-g.png'></figure><p>Solution Example</p><p><strong>Layers</strong></p><p>Core Layer has some constants and helper classes. Domain Layer is where the business logic implements and all the business decisions are made here. The Application layer is more behavioral than the others. Because this layer chooses the clients logically and routing them to their own domain layers. UI Layer is the first layer to consume client requests and can manipulate data to deliveries to the application layer. Below there is an example layer dependency scheme;</p><p>&nbsp;</p><figure class='image'><img src='https://miro.medium.com/max/1122/1*ABwcRmQ3A1laHbCNZgljNw.png'></figure>', N'Domain-Driven Design', 32, N'What is Domain-Driven Design?', N'https://www.scrum.org/themes/custom/scrumorg/assets/images/logo-250.png', NULL)
